import React from "react";
import { useLocation, Link } from "react-router-dom";

import Subway from "./Subway";
import SubwaySlider from './SubwaySlider';

import data from '../dummy/restaurant.json';
import Slider from 'react-slick';
import '../css/Slider.css';

import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Test = () => {
    const settings = {
        dots: true,
        infinite: true,
        slidesToShow: 3,
        slidesToScroll: 1,
        autoplay: true,
        speed: 2000,
        autoplaySpeed: 2000,
        cssEase: "linear"
      };


    return (
        <>
        {/* <div>

        <SubwaySlider props={data.list[0].subway}/>
        </div> */}

        <div className='subway'>
            <div className='subway-top'>
                <div className='prev'><img src={process.env.PUBLIC_URL + `image/rImg/달콤한위로.png`} alt="" /></div>
                <div className='content'><img src={process.env.PUBLIC_URL + `image/rImg/달콤한위로.png`} alt=""/></div>
                <div className='next'><img src={process.env.PUBLIC_URL + `image/rImg/달콤한위로.png`} alt=""/></div>
            </div>
        </div>
        <div>
            <h1>Here is SubwaySlider.js components position</h1>
        </div>

        <div className="autoSlider">
        <Subway />
            <Slider {...settings}>
                {data.list.map( item => (

                        <div className="menu">
                            <div className="menu-top">
                                <Link to={`/introduction/${item.rastaurant}`}>
                                <img src={process.env.PUBLIC_URL + `${item.rImg}`} alt={item.rastaurant}/>
                                </Link>
                                <h1>{item.rastaurant}</h1>
                            </div>
                            <div className="menu-bottom">
                                <p>지하철역: {item.subway}</p>
                                <p className="category">카테고리: {item.category}</p>
                            </div>                        
                        </div>

                ))}
            </Slider>
        </div> 
        </>
    );
}
export default Test;
